import React, { Component } from 'react';
import './Home.css';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';

import Place from './Place';

const tempValue = {
    "image": "https://placeimg.com/64/64/1"
}


class Home extends Component {
    render() {
        return (
            <BrowserRouter>
                <div>
                    <Link to="/" home-title>
                        <h1 class="home-title">Date Mate</h1>
                    </Link>
                    <div class="home-search-bar">
                        <div class="home-search-icon" ><img class="icon-image" src={tempValue.image} alt="search-icon" /></div>
                        <input class="home-search-text" type="text" />
                        <input class="home-search-button" type="button" value="검색" />
                    </div>
                    <div class="home-menu">
                        <input class="home-menu-weather" type="button" value="실시간 기상 검색" />
                        <Link to="/place" class="home-metnu-place">
                            추천 장소
                        </Link>
                    </div>
                </div>
                <Switch>
                    <Route path="/place" component={Place}/>
                </Switch>
            </BrowserRouter>
        )
    }
}

export default Home;
